import '../style/landingPage.css';
import { Link } from "react-router-dom";
const LandingPage=()=>{
    return(
        <div className="LandingPage">

            <div className="selectLogin">
                <h1 id="idh">Library Management System</h1>
                <div className="Land_img">
                    <img id="images/landimg1.jpg" width="100px" height="100px" src="images/adminicon.png" alt="" />
                    <img id="images/landimg2.jpg" width="100px" height="100px" src="images/usericon.png" alt="" />
                </div>
                <div className="btnn">
                <Link to='/admin-login' className="btn1">Admin Login</Link>
                <Link to='/user-login' className="btn2">User Login</Link>
                </div>
    


            </div>

        </div>
    )
}
export default LandingPage;
